        result += '<ProtoInstance'
        if self.DEF:
            result += " DEF='" + self.DEF + "'"
        if self.USE:
            result += " USE='" + self.USE + "'"
        if self.class_:
            result += " class='" + self.class_ + "'"
        if self.name:
            result += " name='" + self.name + "'"
