        if self.center != (0, 0, 0):
            result += " center " + SFVec3f(self.center).VRML() + ""
        if self.class_:
            result += " class " +  '"' + self.class_ + '"' + ""
        if not self.enabled: # default=true
            result += " enabled " + SFBool(self.enabled).VRML() + ""
        if self.size != (0, 0, 0):
            result += " size " + SFVec3f(self.size).VRML() + ""
